  "Marc Torrisi": 30,
  "Qualin Critch": 50
};

return items.map(item => {
  const fullName = `${item.json.firstName} ${item.json.lastName}`;
  const basePrice = item.json.booking_price ?? item.json.service_price ?? 0;
  const discount = discounts[fullName] || 0;
  const finalPrice = Math.max(basePrice - discount, 0);

  item.json.finalPrice = finalPrice;
  item.json.discount = discount;
  return item;
});

